import React, {Component} from 'react';
import './App.css';
import hamburguerMenu from './img/abrir-menu.svg'


class BarraTopo extends Component {
  render() {
    return (
      <div>
        <div className="barra-topo">

        </div>      
      </div>
    );
  };
};

class NavbarIT extends Component {
  render() {
    return (
      <div>
        <nav>
            <ul>
                <li><a href="">HOME</a></li>
                <li><a href="">O PROJETO</a></li>
                <li><a href="">CONTEÚDOS</a></li>
                <li><a href="">NOTÍCIAS</a></li>
                <li><a href="">PARTICIPANTES</a></li>
                <li><a href="">FALE CONOSCO</a></li>
            </ul>
            <div className="midias-icones">
                <h1 className="fa fa-instagram" aria-hidden="true"></h1>&nbsp&nbsp
                <i className="fa fa-facebook-official" aria-hidden="true"></i>
            </div>
        </nav>
    </div>
    );
  };
};

function App() {
  return (
    <div className="App">
      <BarraTopo/>
      <NavbarIT/>
    </div>
  );
}

export default App;
